Specifies that the checkbox must be checked before the form can be submitted. Note that, at the time of writing, Safari and Internet Explorer do not support this property.
Secret chats are accepted or refused automatically, based on a value in the settings (by default MadelineProto is set to accept all secret chats).
Before sending any message, you must check if the secret chat was accepted by the other client with the following method:
$status is 0 if the chat cannot be found in the local database, 1 if the chat was requested but not yet accepted, and 2 if it is a new secret chat.
You can also listen for a message being sent by the other client, and respond with a message of your own, or simply ignore the message if it is not from the other client:
if ($status == 2) {
  // This client is not a secret chat, so ignore the message
} else {
  // This client is a secret chat, so respond with a message of your own
}

You can also use a script to listen for all secret chats on a page and respond with a message to all clients on the page (assuming they are all the same client
